import { Blocks } from "react-loader-spinner";
import classes from "./Loader.module";

export default function Loader() {
  return (
    <div className={classes.loader}>
      <Blocks
        visible={true}
        height="80"
        width="80"
        ariaLabel="blocks-loading"
        wrapperStyle={{}}
        wrapperClass="blocks-wrapper"
      />
    </div>
  );
}
